{
		"name": "PhylolibWorkflow",
	  "description": "A test workflow for Phylolib",
		"start_date": "2022-11-29T19:45:00.000Z",		
		"tasks": [
			{			
			"id": "hamming",
			"tool": "Phylolib",
			"action": {
        "command": "distance hamming --dataset=ml:/phylolib/data/datasets/10.txt --out=symmetric:/phylolib/out.txt"
			},			
			"children": ["upgma"]
		},
		{			
			"id": "upgma",
			"tool": "Phylolib",
			"action": {				
        "command": "algorithm upgma --out=newick:/phylolib/tree.txt --matrix=symmetric:/phylolib/out.txt"	
			},				
			"children": []
		}
	]
}

{
  "general": {
    "name": "Phylolib",
    "description": "The updated phylolib library"
  },
  "access": {
    "_type": "library",
    "library": {
      "address": "localhost",      
      "dockerUrl": "unix://var/run/docker.sock",
      "dockerImage": "luanab/phylolib",
      "dockerContainer": "phylolib",
			"dockerAutoRemove": true,        
			"dockerNetworkMode": "bridge",
			"dockerApiVersion": "auto",
      "dockerVolumes": [{
				"source": "/opt/.phylolibVol",
				"target": "/phylolib",
				"_type": "bind"
			}]
    }
  },
  "library": [
    {
      "name": "Arguments",
      "order": 0,
      "invocation": "-args",
      "allowCommandRep": false,
      "commands": [
        {
          "name": "help",
          "invocation": ["help"]
        },
        {
          "name": "distance",
          "invocation": ["distance"],
          "allowedValues": ["hamming", "grapetree", "kimura"],
          "allowedCommandSets": ["Options"]
        },
        {
          "name": "correction",
          "invocation": ["correction"],
          "allowedValues": ["jukescantor"],
          "allowedCommandSets": ["Options"]
        },
        {
          "name": "algorithm",
          "invocation": ["algorithm"],
          "allowedValues": [
            "goeburst",
            "edmonds",
            "sl",
            "cl",
            "upgma",
            "upgmc",
            "wpgma",
            "wpgmc",
            "saitounei",
            "studierkepler",
            "unj"
          ],
          "allowedCommandSets": ["Options"]
        },
        {
          "name": "optimization",
          "invocation": ["optimization"],
          "allowedValues": ["lbr"],
          "allowedCommandSets": ["Options"]
        }
      ]
    },
    {
      "name": "Options",
      "order": 1,
      "allowCommandRep": true,
      "commands": [
        {
          "name": "File Output",
          "description":
            "Output file as <format>:<location> with format being (asymmetric|symmetric|newick|nexus)",
          "invocation": ["-o", "--out"],
          "allowedValues": ["file"]
        },
        {
          "name": "Dataset Input",
          "description":
            "Input dataset file as <format>:<location> with format being (fasta|ml|snp)",
          "invocation": ["-d", "--dataset"],
          "allowedValues": ["file"]
        },
        {
          "name": "Distance Matrix Input",
          "description":
            "Input distance matrix file as <format>:<location> with format being (asymmetric|symmetric)",
          "invocation": ["-m", "--matrix"],
          "allowedValues": ["file"]
        },
        {
          "name": "Phylogenetic Tree Input",
          "description":
            "Input phylogenetic tree file as <format>:<location> with format being (newick|nexus)",
          "invocation": ["-m", "--matrix"],
          "allowedValues": ["file"]
        },
        {
          "name": "Limit of focus variants",
          "description":
            "Limit of locus variants to consider using goeBURST algorithm [default: 3]",
          "invocation": ["-l", "--lvs"],
          "allowedValues": ["file"]
        }
      ]
    }
  ]
}

